import React from "react";

import ShopItemCard from "../shop-item-card/shop-item-card.component";

const ShopItem = ({ label, items }) => {
  return (
    <div className="shop-item">
      {label}
      {items.map((item) => (
        <ShopItemCard key={item.id} item={item} />
      ))}
    </div>
  );
};

export default ShopItem;
